/// <h2>Usage Example</h2>
/// \code
/// ZohoSalesIQ.Chat.startChat(question: "Hello, I need assistance.")
///
/// \endcodeprecondition:
/// Question should not be nil
/// \param question - String value determines question to initiate the chat 
///
